%script
-- Drop any previously existing CUSTOMERS360 table for notebook repeatability
BEGIN
      EXECUTE IMMEDIATE 'DROP Table CUSTOMERS360';
  EXCEPTION
      WHEN OTHERS THEN NULL;
END;
/

-- JOIN selected attributes from SH.CUSTOMERS and SH.SUPPLEMENTARY_DEMOGRAPHICS tables to create better 360 view of customer
Create table CUSTOMERS360 as SELECT a.CUST_ID, a.CUST_GENDER, a.CUST_MARITAL_STATUS, a.CUST_YEAR_OF_BIRTH, a.CUST_INCOME_LEVEL, a.CUST_CREDIT_LIMIT, b.EDUCATION, b.AFFINITY_CARD, b.HOUSEHOLD_SIZE, b.OCCUPATION, b.YRS_RESIDENCE, b.Y_BOX_GAMES
   FROM SH.CUSTOMERS a, SH.SUPPLEMENTARY_DEMOGRAPHICS b
   WHERE a.CUST_ID = b.CUST_ID;

%script 

